<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <title>AT Level I Certificate Generator</title>
  <style>
    body {
      font-family: system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
      background: #f4f4f4;
      margin: 0;
      padding: 2rem;
      display: flex;
      justify-content: center;
    }
    .container {
      background: #ffffff;
      border-radius: 8px;
      padding: 2rem 2.5rem;
      max-width: 600px;
      width: 100%;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.08);
    }
    h1 {
      margin-top: 0;
      font-size: 1.6rem;
      text-align: center;
    }
    label {
      font-weight: 600;
      display: block;
      margin-bottom: 0.4rem;
    }
    input[type="text"] {
      width: 100%;
      padding: 0.6rem 0.75rem;
      font-size: 1rem;
      border-radius: 4px;
      border: 1px solid #ccc;
      box-sizing: border-box;
      margin-bottom: 1rem;
    }
    button {
      display: inline-block;
      padding: 0.7rem 1.4rem;
      font-size: 1rem;
      border-radius: 4px;
      border: none;
      cursor: pointer;
      background: #0066cc;
      color: white;
      font-weight: 600;
    }
    button:disabled {
      opacity: 0.6;
      cursor: default;
    }
    .help-text {
      font-size: 0.9rem;
      color: #666;
      margin-top: 0.75rem;
    }
    .status {
      margin-top: 0.75rem;
      font-size: 0.9rem;
    }
  </style>
</head>
<body>
  <div class="container">
    <h1>Generate AT Level I Certificate PDF</h1>

    <label for="nameInput">Name to appear on certificate:</label>
    <input id="nameInput" type="text" placeholder="Enter full name (e.g., JOHN DOE)" />

    <button id="generateBtn">Generate PDF</button>

    <div class="help-text">
      This page uses an embedded base64 PDF as the background template.
    </div>

    <div id="status" class="status"></div>
  </div>

  function base64ToUint8Array(base64) {
    const raw = atob(base64);
    const uint8Array = new Uint8Array(raw.length);
    for (let i = 0; i < raw.length; i++) {
      uint8Array[i] = raw.charCodeAt(i);
    }
    return uint8Array;
  }

  const nameInput = document.getElementById("nameInput");
  const generateBtn = document.getElementById("generateBtn");
  const statusEl = document.getElementById("status");

  async function generatePdf() {
    const name = nameInput.value.trim();
    if (!name) {
      statusEl.textContent = "Please enter a name.";
      return;
    }

    try {
      generateBtn.disabled = true;
      statusEl.textContent = "Generating...";

      const { PDFDocument, StandardFonts, rgb } = PDFLib;

      // Load base64 template
      const templateBytes = base64ToUint8Array(TEMPLATE_PDF_BASE64);
      const pdfDoc = await PDFDocument.load(templateBytes);

      const font = await pdfDoc.embedFont(StandardFonts.HelveticaBoldOblique);

      const page = pdfDoc.getPages()[0];

      const rotation = page.getRotation().angle || 0;
      const { width, height } = page.getSize();

      // Text styling similar to the original
      const fontSize = 28;
      const textWidth = font.widthOfTextAtSize(name, fontSize);

      // Desired visual position (adjust as needed)
      const visualX = (width) / 2 + 10;
      const visualY = (height - textWidth) / 2 - 1;

      // Counter-rotation matrix
      page.drawText(name, {
        size: fontSize,
        font,
        color: rgb(0, 0, 0),
        x: visualX,
        y: visualY,
        rotate: PDFLib.degrees(-270)   //  FIXED
      });

      const pdfBytes = await pdfDoc.save();

      const blob = new Blob([pdfBytes], { type: "application/pdf" });
      const url = URL.createObjectURL(blob);

      const a = document.createElement("a");
      a.href = url;
      a.download = `AT_Certificate_${name.replace(/\s+/g, "_")}.pdf`;
      a.click();

      URL.revokeObjectURL(url);
      statusEl.textContent = "PDF generated.";
    } catch (err) {
      console.error(err);
      statusEl.textContent = "Error: " + err.message;
    } finally {
      generateBtn.disabled = false;
    }
  }

  generateBtn.addEventListener("click", generatePdf);
  nameInput.addEventListener("keydown", (e) => {
    if (e.key === "Enter") generatePdf();
  });
</script>
